import { Routes, Route } from "react-router-dom";
import UkrainianMainPage from "./pages/UkrainianMainPage";
function App() {
  return (
    <>
      <Routes>
        <Route path="" element={<UkrainianMainPage />} />
      </Routes>
    </>
  );
}

export default App;
